    public static void main(String[] args) {
        StringBuilder sb = new StringBuilder();
        String pattern = "<rect x=\"{0}\" y=\"{1}\" width=\"1\" height=\"1\" fill=\"{2}\"/>\r\n";
        for (int i = 0; i < data.length; i++) {
            if (data[i] != 0) {
                int x = i % 32;
                int y = i / 32;
                sb.append(MessageFormat.format(pattern, x, y, intToHexColor(data[i])));
            }
        }
        System.out.println(sb);
    }

    private static String intToHexColor(int color) {
        int red = (color >> 16) & 0xFF;
        int green = (color >> 8) & 0xFF;
        int blue = color & 0xFF;
        return String.format("#%02x%02x%02x", blue, green, red);
    }
